import React, { Component } from "react";
import API from "../utils/API";
import Card from "../components/Card";
import Alert from "../components/Alert";

class Discover extends Component {
  state = {
    image: "",
    match: false,
    matchCount: 0
  };

  render() {
    return (
      <div class="col s7">
        <div class="container">
          <form>
            <span>
              Zip Code:{" "}
              <input
                id="to-do"
                type="text"
                class="form-control"
                name="fullName"
                value=" "
              ></input>
            </span>
            <span>
              <input
                id="add-to-do"
                class="btn waves-effect waves-light"
                value="submit"
                type="submit"
              ></input>
            </span>
          </form>
          <div>
            <img
              src="https://i.dlpng.com/static/png/4322884-popular-doctor-doctor-cartoon-images-png-transparent-png-cartoon-doctor-png-820_580_preview.webp"
              className="bodyContent"
            ></img>
          </div>
        </div>
      </div>
    );
  }
}

export default Discover;
